--
-- Bẫy `Departments`
--
DELIMITER $$
CREATE TRIGGER `department_delete` AFTER DELETE ON `Departments` FOR EACH ROW BEGIN
	IF EXISTS (
        SELECT *
        FROM Users u
        WHERE u.DepartmentID = OLD.DepartmentID
    ) THEN
        UPDATE Users
        SET DepartmentID = NULL
        WHERE DepartmentID = OLD.DepartmentID;
    END IF;
END
$$
DELIMITER ;

