--
-- Bẫy `Positions`
--
DELIMITER $$
CREATE TRIGGER `delete_position` AFTER DELETE ON `Positions` FOR EACH ROW BEGIN
	IF EXISTS (
        SELECT *
        FROM Users u
        WHERE u.PositionID = OLD.PositionID
    ) THEN
        UPDATE Users
        SET PositionID = NULL
        WHERE PositionID = OLD.PositionID;
    END IF;
END
$$
DELIMITER ;

