--
-- Bẫy `TaskPerformers`
--
DELIMITER $$
CREATE TRIGGER `updateProgress` AFTER UPDATE ON `TaskPerformers` FOR EACH ROW BEGIN
	DECLARE totalProgress DECIMAL(5,2);
    DECLARE totalPerformers INT;
    
    SELECT SUM(Progress) INTO totalProgress
    FROM TaskPerformers
    WHERE TaskID = NEW.TaskID;

    SELECT COUNT(*) INTO totalPerformers
    FROM TaskPerformers
    WHERE TaskID = NEW.TaskID;
    
    UPDATE Tasks
    SET Progress = totalProgress / totalPerformers
    WHERE TaskID = NEW.TaskID;
END
$$
DELIMITER ;

